import styled from 'styled-components'

const FooterWrapper = styled.footer`
  background-color: grey;
  bottom: 0;
  padding: 0.1rem 0;
  position: fixed;
  width: 100%;
`
const Heading = styled.h4`
  color: white;
  font-size: 1rem;
  text-align: center;
`

export { FooterWrapper, Heading }
